import React from 'react'

const PendingPayments = (props) => {
    const blocks = ['Advance payments','Pending Payments']
  return (
    <div className='bg-seashell'>
       <h6 className='fs-6'>{props.patientname} Pending Payment</h6> 
       <button className='btn-close position-absolute end-0 p-2 top-0'></button>
       <div className="container">
        <div className="row" gx-2>
            {
                blocks.map((Data)=>(
                    <div className="col-3">
                    <button className='button button-charcoal shadow'>{Data}</button>
                    </div>
                ))
            }
           
        </div>
       </div>

    </div>
  )
}

export  {PendingPayments}
